import React from 'react'

const Country = ({ name, population, continent, area }) => {
    // console.log(name);

    return (

        <div className='oneCountry'>
            <span className='countryItem itemName'>{name}</span>
            <span className='countryItem itemPopulation'>{population}</span>
            <span className='countryItem itemContinent'>{continent}</span>
            <span className='countryItem itemArea'>{area}</span>
        </div>
    )
}
export default Country;
